CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `detayli_toplam`  AS  select `h`.`TID` AS `TID`,`h`.`Terminal NO` AS `Terminal No`,`h`.`Terminal` AS `Terminal`,count('Bilet NO') AS `Bilet`,count(`h`.`Transfer`) AS `TransferToplam`,count(`h`.`Fiktif`) AS `Fiktif` from (select `terminaller`.`ELTID` AS `Terminal NO`,`terminaller`.`TERMINAL_AD` AS `Terminal`,`biletler`.`BILET_NO` AS `Bilet NO`,`biletler`.`SIS_TAR` AS `Alınma Tarihi`,`biletler`.`ISLEM_BAS_TAR` AS `Çağrı Saati`,`biletler`.`ISLEM_BIT_TAR` AS `İşlem Bitiş Saati`,(case `biletler`.`TRANSFER` when 'false' then '' when 'true' then 'Transfer' end) AS `Transfer`,(case `biletler`.`OZEL_MUSTERI` when 'false' then '' when 'true' then 'Fiktif Bilet' end) AS `Fiktif`,`biletler`.`GRPID` AS `GRPID`,`terminaller`.`TID` AS `TID` from (`terminaller` join `biletler` on((`terminaller`.`TID` = `biletler`.`TID`)))) `h` group by `h`.`TID`,`h`.`Terminal NO`,`h`.`Terminal` ;

